"fixed": |-
  1.  The Document data is a set of Input Pages in a known media type. The "page-ranges" attribute is used to select, as specified in Section 5.2.7, a sub-sequence of the pages in the print-stream that are to be processed and imaged.
"ko": |-
  1. 문서 데이터는 알려진 미디어 유형의 입력 페이지 세트입니다. "페이지 범위" 속성은 섹션 5.2.7에 지정된 대로 처리 및 이미지화할 인쇄 스트림의 페이지 하위 순서를 선택하는 데 사용됩니다.
